//数据初始化在reducer
import action from '../actions/actionType'
const initState = [{
    id:1,
    title: 'Apple',
    amount: 10,
    price: 888.66
},{
    id:2,
    title: 'Orange',
    price: 4444.66,
    amount: 12
}]


export default (state = initState, action) => {
    console.log(action)
    switch(action.type){
        default:
            return state
    }
}
